INSERT INTO wmall.products (name, category_id, status, price, detail, buy_count, total_sale, image_id, image_ids, remark, original_price, created_at, updated_at, deleted_at, browse_count) VALUES ('6 x Hartwall Novelle Raspberry-Lemon', 16, 1, 5.29, 'Novelle Fresh is today\'s natural and light thirst drink. The base of the drink is fresh mineral water, and the delicious raspberry-lemon flavor comes from a splash of full juice. The drink is stripped of all unnecessary; it has no added sugar or artificial sweeteners. The sweetness of the drink comes only from the juice and there is less than 0.5g/100ml of sugar in it.', 0, 0, 143, '[144]', '', null, null, null, null, 0);
INSERT INTO wmall.products (name, category_id, status, price, detail, buy_count, total_sale, image_id, image_ids, remark, original_price, created_at, updated_at, deleted_at, browse_count) VALUES ('15-pack Coca-Cola', 17, 1, 11.39, 'Coca-Cola is by far the most popular soft drink in Finland and throughout the world. It is a genuine and original cola drink, the recipe of which is still a secret, more than 130 years after the first glass. Coca-Cola\'s inimitable cola taste and refreshment are based on the same traditional recipe all over the world. But one thing about the recipe is known for sure. Namely, that no preservatives or artificial flavors have been added to the drink.', 0, 0, 145, '[146]', '', null, null, null, null, 0);
INSERT INTO wmall.products (name, category_id, status, price, detail, buy_count, total_sale, image_id, image_ids, remark, original_price, created_at, updated_at, deleted_at, browse_count) VALUES ('15-pack Coca-Cola Zero Sugar-free', 17, 1, 10.79, 'Coca-Cola Zero® Sugar is a soft drink that tastes just as great as the original Coca-Cola, but without the sugar. The drink has zero calories, i.e. it contains energy of only 1.4 kJ / 0.3 kilocalories per deciliter. Young adults in particular have taken Coca-Cola Zero® Sugar as their soft drink option. The drink contains only natural flavors and no preservatives have been added. This way you can enjoy the original taste of Coca-Cola, without sugar.', 0, 0, 147, '[148]', '', null, null, null, null, 0);
INSERT INTO wmall.products (name, category_id, status, price, detail, buy_count, total_sale, image_id, image_ids, remark, original_price, created_at, updated_at, deleted_at, browse_count) VALUES ('Valio whole orange juice 1 l', 18, 1, 1.89, 'Valio full orange juice is a classic on the breakfast table that the whole family can enjoy. The juice content of whole juices is always 100%, and only vitamin C has been added to whole orange juice. One dl of Valio full orange juice contains no less than 75% of the daily recommended intake of vitamin C. Try other Valio full juices too!', 0, 0, 149, '[150]', '', null, null, null, null, 0);
INSERT INTO wmall.products (name, category_id, status, price, detail, buy_count, total_sale, image_id, image_ids, remark, original_price, created_at, updated_at, deleted_at, browse_count) VALUES ('Valio organic blueberry juice 1 l', 18, 1, 2.35, 'Valio Hedelmätarha® organic blueberry juice tastes fresh and homey. The high-quality and delicious breakfast and snack drink contains blueberry juice from domestic organic blueberries. Valio Luomu™ is a sustainable choice for biodiversity. Check out other Valio Luomu™ products as well!', 0, 0, 151, '[152]', '', null, null, null, null, 0);
INSERT INTO wmall.products (name, category_id, status, price, detail, buy_count, total_sale, image_id, image_ids, remark, original_price, created_at, updated_at, deleted_at, browse_count) VALUES ('Valio organic apple juice 1 l', 18, 1, 2.35, 'Valio Hedelmätarha® organic apple juice is a gently refreshing start to the day! High-quality, cloudy "cloudy" full juice from organic apples. Valio Luomu™ is a sustainable choice for biodiversity. Check out other Valio Luomu™ products as well!', 0, 0, 153, '[154]', '', null, null, null, null, 0);
