INSERT INTO wmall.products (name, category_id, status, price, detail, buy_count, total_sale, image_id, image_ids, remark, original_price, created_at, updated_at, deleted_at, browse_count) VALUES ('Monster Ultra White energy drink', 19, 1, 2.05, 'Zero sugar, zero calories! Carbonated, energy drink without sugar, without calories - New, less sweet and lighter Monster Energy Ultra is zero calories, but full of Monster Energy. So, white is the new black. Unleash the Ultra Beast!', 0, 0, 159, '[160]', '', null, null, null, null, 0);
INSERT INTO wmall.products (name, category_id, status, price, detail, buy_count, total_sale, image_id, image_ids, remark, original_price, created_at, updated_at, deleted_at, browse_count) VALUES ('Battery energy drink 0.33 L', 19, 1, 2.59, 'Pure energy. Finland\'s most popular energy drink since 1997. Battery Energy Drink is a vitaminized energy drink whose power is based on coffee and guarana extracts and taurine. Battery is a drink developed by Sinebrychoff, which is exported to more than 20 countries around the world.', 0, 0, 161, '[162]', '', null, null, null, null, 0);
INSERT INTO wmall.products (name, category_id, status, price, detail, buy_count, total_sale, image_id, image_ids, remark, original_price, created_at, updated_at, deleted_at, browse_count) VALUES ('Ginger Kombucha 350ml', 20, 1, 3.75, 'Ginger kombucha, which tickles the taste buds, makes the joy splash and the energy returns even to a tired body. With plenty of cold-pressed ginger juice, Fresh Ginger kombucha is every ginger lover\'s belly-pleasing trusted partner, where healthiness and deliciousness go hand in hand. Catch up and get excited yourself!
INSERT INTO wmall.products (name, category_id, status, price, detail, buy_count, total_sale, image_id, image_ids, remark, original_price, created_at, updated_at, deleted_at, browse_count) VALUES ('Singapore Ice Coffee 235 ml', 20, 1, 1.89, 'Paulig Singapore Ice Coffee is a cold coffee drink inspired by Singapore, which contains dark roasted coffee and milk. The robusta coffee contained in the coffee mix brings richness and strength to the coffee\'s taste. The drink is also lactose-free and Fair Trade certified.', 0, 0, 165, '[166]', '', null, null, null, null, 0);
INSERT INTO wmall.products (name, category_id, status, price, detail, buy_count, total_sale, image_id, image_ids, remark, original_price, created_at, updated_at, deleted_at, browse_count) VALUES ('New York Cold Brew Latte 235 ml', 20, 1, 1.89, 'Paulig New York Cold Brew Latte is a soft milk coffee drink that gets its taste from Paulig Cold Brew cold-extracted coffee. The nuanced and naturally sweet taste of the coffee drink is created by extracting freshly ground coffee for 16 hours in cold water. The Paulig New York Cold Brew Latte cold drink is inspired by New York\'s coffee culture and is especially suitable for real coffee lovers who are looking for convenient alternatives to hot coffee drinks.
INSERT INTO wmall.products (name, category_id, status, price, detail, buy_count, total_sale, image_id, image_ids, remark, original_price, created_at, updated_at, deleted_at, browse_count) VALUES ('Parisien Café au Lait 235ml', 20, 1, 1.89, 'Paulig Parisien Café au Lait is a neat and classic French coffee drink that contains dark roasted coffee and milk. The robusta contained in the dark roasted coffee brings depth to the taste of the coffee drink. Paulig Parisien Café au Lait brings the taste world of the traditional Parisian Café au lait to a fresh cold coffee drink. The cold drink is especially suitable for real coffee lovers who are looking for convenient alternatives to hot coffee drinks.
INSERT INTO wmall.products (name, category_id, status, price, detail, buy_count, total_sale, image_id, image_ids, remark, original_price, created_at, updated_at, deleted_at, browse_count) VALUES ('Starbucks 200 ml Doubleshot Espresso', 20, 1, 2.3, 'Starbucks Doubleshot espresso milk coffee drink is a mixture of Starbucks Arabica coffee and fresh milk. Keeps at room temperature. Enjoy cold. Homogenized and sterilized. High caffeine content (47mg/100ml).', 0, 0, 167, '[168]', '', null, null, null, null, 0);
INSERT INTO wmall.products (name, category_id, status, price, detail, buy_count, total_sale, image_id, image_ids, remark, original_price, created_at, updated_at, deleted_at, browse_count) VALUES ('Bundaberg 37.5cl Ginger Beer 0%', 33, 1, 2.85, 'Non-alcoholic ginger beer. The full flavor is achieved by boiling the wort for three days. Locally produced ginger and sugar cane are used for production.', 0, 0, 173, '[174]', '', null, null, null, null, 0);
INSERT INTO wmall.products (name, category_id, status, price, detail, buy_count, total_sale, image_id, image_ids, remark, original_price, created_at, updated_at, deleted_at, browse_count) VALUES ('Fazer Toast Five grains 505g', 5, 1, 2.15, 'Fazer Paahto Viisi graina is a delicious grainy bread, the taste of which is brought by the root of the dough, as well as the seeds and grains, which are abundant in the bread. As the name suggests, the bread contains five grains and it has received the Joutsenmark for the use of domestic grain. Fazer was the first to bring toast to Finland in 1966, after which the Fazer Paahto product family has expanded to include many delicious options. What all Fazer Paahto breads have in common is a delicious taste and offering perfect toasting pleasure; wonderfully soft interior combined with a delicious crispy crust. In addition, all Fazer Paahto breads are baked in Finland, at Fazer\'s Vantaa Bakery.', 0, 0, 175, '[176]', '', null, null, null, null, 0);
INSERT INTO wmall.products (name, category_id, status, price, detail, buy_count, total_sale, image_id, image_ids, remark, original_price, created_at, updated_at, deleted_at, browse_count) VALUES ('Fairy Rapeseed oil 1 l', 9, 1, 5.49, 'High-quality Keiju rapeseed oil is a trusted product in every kitchen, as it is suitable for both general cooking and frying as well as baking and deep-frying. Rapeseed oil contains plenty of omega-3 fatty acids and vitamin E.', 0, 0, 177, '[178]', '', null, null, null, null, 0);
INSERT INTO wmall.products (name, category_id, status, price, detail, buy_count, total_sale, image_id, image_ids, remark, original_price, created_at, updated_at, deleted_at, browse_count) VALUES ('Fazer Souffeli Puffi Snacks', 10, 1, 3.05, 'Suffeli is a crispy classic that has been a delight since 1966. Underneath the chocolate coating of Suffeli Puffi Snack sweets, a crispy corn puff is revealed. Now it\'s easy to enjoy Suffeli Puffi Snack sweets in a vertical bag suitable for snacking. Best of all, all Fazer\'s delicious chocolates are made from 100% responsibly produced cocoa. Treat yourself to a bag or share with friends!', 0, 0, 179, '[180]', '', null, null, null, null, 0);
INSERT INTO wmall.products (name, category_id, status, price, detail, buy_count, total_sale, image_id, image_ids, remark, original_price, created_at, updated_at, deleted_at, browse_count) VALUES ('Karl Fazer raspberry yogurt chocolate', 10, 1, 4.85, 'In Karl Fazer Raspberry Yoghurt candies, soft milk chocolate wraps a fresh raspberry yogurt filling, which brings summer to your tongue. Finland\'s most loved chocolate, whose unique rich taste has been guaranteed by the best ingredients since 1922. All Fazer\'s delicious chocolates are made from 100% responsibly produced cocoa. A box of chocolates is a wonderful gift for festive occasions!', 0, 0, 181, '[182]', '', null, null, null, null, 0);
INSERT INTO wmall.products (name, category_id, status, price, detail, buy_count, total_sale, image_id, image_ids, remark, original_price, created_at, updated_at, deleted_at, browse_count) VALUES ('Karl Fazer milk chocolate', 10, 1, 5.95, 'Finland\'s most loved chocolate, whose unique rich taste has been guaranteed by the best ingredients since 1922. In addition to the taste of this milk chocolate made from real milk, you will also recognize the blue wrapper, whose golden Karl Fazer signature acts as a guarantee of quality. Best of all, all Fazer\'s delicious chocolates are made from 100% responsibly produced cocoa. Give a chocolate box suitable for the best moments as a gift or enjoy it with friends.', 0, 0, 183, '[184]', '', null, null, null, null, 0);
INSERT INTO wmall.products (name, category_id, status, price, detail, buy_count, total_sale, image_id, image_ids, remark, original_price, created_at, updated_at, deleted_at, browse_count) VALUES ('Fazer Geisha hazelnut nougat chocolate', 10, 1, 5.95, 'Delicious Geisha candies, where soft milk chocolate hides a crunchy hazelnut nougat filling. Best of all, all Fazer\'s delicious chocolates are made from 100% responsibly produced cocoa. Be inspired by peace and offer friends a moment of time together. A beautiful box of chocolates is also a gift that will be remembered.', 0, 0, 185, '[186]', '', null, null, null, null, 0);
INSERT INTO wmall.products (name, category_id, status, price, detail, buy_count, total_sale, image_id, image_ids, remark, original_price, created_at, updated_at, deleted_at, browse_count) VALUES ('Leader Performance WHEY protein powder 500g', 34, 1, 14.45, 'Leader Performance Whey Chocolate is a chocolate-flavored whey protein concentrate made from high-quality whey. Whey protein is a fast-absorbing, milk-derived protein with an excellent amino acid profile. It contains a lot of branched-chain amino acids (BCAA), which makes whey a popular protein supplement for building and maintaining muscle mass. Enjoy a highly soluble protein supplement as a snack, after training or to increase the protein content of a meal.', 0, 0, 187, '[188]', '', null, null, null, null, 0);
